import React,{useEffect,useContext,createContext}from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import { Provider } from "mobx-react";
import reportWebVitals from './reportWebVitals';
// import store from './store/companyContext';
const root = ReactDOM.createRoot(document.getElementById('root'));
const CompanyContext = createContext(null);
import { createCompanyStore } from "store/companyStore";

import { useLocalObservable } from "mobx-react";
const TodoProvider = ({ children }) => {
  const companyStore = useLocalObservable(createCompanyStore);
  return (
    <CompanyContext.Provider value={companyStore}>{children}</CompanyContext.Provider>
  );
};
const useCompanyStore = () => useContext(CompanyContext);
root.render(
  <React.StrictMode>
    <TodoProvider>
      <App />
    </TodoProvider>
  </React.StrictMode>,
);

// If you want to start measuring performance in your app, pass a function
